import React, { useState } from 'react';
// material
import { Box, Card, Grid, Container, Stack, Typography, CardHeader } from '@mui/material';
// components
import Page from '../components/Page';

export default function Profile() {
  const [username, setUsername] = useState('Julian');
  return (
    <Page title="Dashboard: Profile | Unear">
      <Container>
        <Stack direction="row" alignItems="center" justifyContent="space-between" mb={5}>
          <Typography variant="h4" gutterBottom>
            Profil von {username}
          </Typography>
        </Stack>
        <Card>
          <CardHeader title="Your account credentials" />
          <Box sx={{ px: 3, py: 1 }}>Benutzername: </Box>
          <Box sx={{ px: 3, py: 1 }}>{username}</Box>
        </Card>
      </Container>
    </Page>
  );
}
